import Container from '@mui/material/Container';
import { useParams } from 'react-router-dom';
import React from 'react';



function Inicio() {

    return(

           <Container maxWidth="md">
                <h2>Inicio</h2>
                <p>Nombre: {name}</p>
                <p>Apellido: {apellido}</p>
            </Container>

    )
}
export default Inicio;
